import React from "react";
import Options from "./Options.js";

class SideBar extends React.Component{

    constructor(){
        super();
        this.state={};
    }

    render(){
        return(
            <div id="sidebar-container">
                <div id="sidebar">
                    <div id="greetings-container">
                        <p id="greetings">Hello, Willy</p>
                    </div>
                    <Options />
                    <Options />
                </div>
            </div>
        );
    }
}

export default SideBar;
